    const addTodo = todo =>{
        if(!todo.text || /^\s*$/.test(todo.text))
        {
            return
        }

        const newTodos = [todo, ...todos]

        setTodos(newTodos);
        console.log(...todos);
        
    }

  return (
    <div>
        <h1> sELOCO </h1>
        <TodoForm onSub={addTodo} />
    </div>
  );

}

